    diff1 = diff(det,a(1,p));
    for q = 1:n
        if length(unique([p,q])) ~= length([p,q])
            continue
        end
        diff2 = diff(diff1,a(2,q));
        kron12 = sparse(kron(psi1(:,:,p),psi2(:,:,q)));
        for r = 1:n
            if length(unique([p,q,r])) ~= length([p,q,r])
                continue
            end
            diff3 = diff(diff2,a(3,r));
            sparsePsi = sparse(psi3(:,:,r));
            kron123 = spkron(kron12,sparsePsi);
            for s = 1:n
                if length(unique([p,q,r,s])) ~= length([p,q,r,s])
                    continue
                end
                diff4 = diff(diff3,a(4,s));
                sparsePsi = sparse(psi4(:,:,s));
                kron1234 = spkron(kron123,sparsePsi);
                for t = 1:n
                    if length(unique([p,q,r,s,t])) ~= length([p,q,r,s,t])
                        continue
                    end
                    diff5 = diff(diff4,a(5,t));
                    sparsePsi = sparse(psi5(:,:,t));
                    kron12345 = spkron(kron1234,sparsePsi);
                    for i = 1:n
                        if length(unique([p,q,r,s,t,i])) ~= length([p,q,r,s,t,i])
                            continue
                        end
                        diff6 = diff(diff5,a(6,i));
                        for j = 1:n
                            if length(unique([p,q,r,s,t,i,j])) ~= length([p,q,r,s,t,i,j])
                                continue
                            end
                            flat(i,j,p,q,r,s,t) = abs(diff(diff6,a(7,j)));
                            disp([p,q,r,s,t,i,j]);
                        end
                    end
                    kosz = kosz + spkron(kron12345,sparse(flat(:,:,p,q,r,s,t)));
                end
            end
        end
    end
end

% Calculate the rank
orbitmat = readmatrix('orbitmat7.dat');
tic;
rk = getRankSymm(kosz, orbitmat, 7)    % rank: 8763494, lower bound of brk(Per7): 55
x=toc;
